import mongoose from "mongoose"
var Schema = mongoose.Schema;

var UserModelSchema = new Schema(
    {
        name: String,
        createdAt: { type: Date, default: Date.now },
    });

var SomeModel = mongoose.model('User', UserModelSchema );

